Between the start of enrollment in September 2011 and the study conclusion in September 2016, 833 infants were enrolled into the cohort and included in this analysis. The mean follow-up time for participants was 1.7 years (19.9 months; 
 Table 1). A total of 9 (1.1%) infants died during the study, with 8 (88.9%) deaths associated with medical illnesses and 1 (11.1%) resulting from an unknown cause. Over 75% of infants completed the study (n = 629), while 23.4% (n = 195) were withdrawn or were lost to follow-up before study completion. The most common reason infants were withdrawn from the study or were lost to follow-up (60.3%, n = 123) was because the child moved away from the study area. We did not observe any significant differences between the demographics of those who completed the study and those who did not (
 Supplemental Table 1).
